import React from 'react'
import classes from "../../css/filterButton.module.css"
import { useState } from 'react'
function FilterButtton(props) {
  const clicked = ()=>{
    props.clicked(true)
  }
  return (
    <div className={classes.button} onClick={clicked}>
        <p>{props.type}</p>
    </div>
  )
}

export default FilterButtton
